(-2981466, NULL, 2, 326, 336, 52, NULL, NULL, NULL, NULL, 5, 'Richard', 'Gubbins', NULL, NULL, NULL, NULL, 'BN9 9EG', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, 1, 0, 'UK', 'FAD', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 20, NULL, 'info@garagedoorrepairssussex.co.uk', NULL, NULL, NULL, NULL, NULL, 'uploads/user/-2984999_-2980000', 'info@garagedoorrepairssussex.co.uk', '1000:yHy4/8p8WJnTGTVUOpLoKFw9Pws43lv5:pFef+JFSyHbkarIcLsgCvkhwAmNsfdXD', NULL, 1441877900, 1, NULL, NULL, NULL, 1366809540, 1441877966, 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, 'Garage Door Repairs Sussex is a family run garage door repair specialists, based in Newhaven Sussex.\r\n\r\nGarage Door Repairs Sussex repair up and over canopy, retractable, sectional roller and side hung garage doors from many manufactures of garage doors, including but not exclusively garage doors from Hörmann, Garador, Henderson, Wessex, Cardale and SWS.\r\n\r\nAutomation of your existing garage door is available. This is dependent on the condition and type of garage door you have. Garage Door Repairs Sussex will be pleased to offer free advice and quotation to automate your current garage door.\r\n\r\nGarage Door Repairs Sussex repair are open from 8am to 8pm 7 days a week. If we are unavailable at any time please leave you contact details and we will return your call as soon as possible.\r\n\r\nGarage Door Repairs Sussex offers a genuine no fix no fee service. if we cannot repair your door there will be no charge.', NULL, NULL, 0, '1083f6fb7a60a65f26fab1a17ba58cec', 0),
